display : "flex",
alignItems : "center",
gap : "16px"
}
const starContainerStyle = {
display : "flex",
gap : "4px"
}
const textStyle  = {
    lineHight : "2"
}
export default function Stars(){
return(<div style={containerStyle}>
<div style={starContainerStyle}>
{Array.from({length : 5} , (_ , i)=>(<span>S{i+1} </span>))}
</div>
<p>5</p>
</div>)
}
